import React from 'react';
import background from './components/Navbar/movinglines.gif';
  
const Home = () => {
  return (
    <div
      style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'left',
        height: '100vh',
        backgroundImage: `url(${background})` 
      }}
    >
      <h1>Home</h1>
    </div>
  );
};
  
export default Home;
